import mainPage from "@/pages/mainPage";
import helpCenter from "@/pages/helpCenter";
import myBlogs from "@/pages/myBlogsPage";
import settingsPage from "@/pages/settingsPage";

export const routes = [
    {path: '/myBlogs', name: 'myBlogs', component: myBlogs},
    {path: '/home', name: 'home', component: mainPage},
    {path: '/help', name: 'help', component: helpCenter},
    {path: '/setting', name: 'setting', component: settingsPage},
    {path: '/', redirect: '/home'}
]
